import React, { useState } from 'react';
import TicTacToe from './Components/tictactoeTicTacToe';

const App: React.FC = () => {
  const [gameStarted, setGameStarted] = useState<boolean>(false);
  const [gameEnded, setGameEnded] = useState<boolean>(false);

  const handleStartGame = () => {
    setGameStarted(true);
  };

  const handleGameEnd = () => {
    setGameEnded(true);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Tic Tac Toe Game</h1>
        {!gameStarted && !gameEnded && (
          <button className="start-button" onClick={handleStartGame}>
            Start Game
          </button>
        )}
        {gameStarted && !gameEnded && <TicTacToe onGameEnd={handleGameEnd} />}
        {gameEnded && <p>Game Over! Thanks for playing.</p>}
      </header>
    </div>
  );
};

export default App;
